import './Dash.css';
import ReturnBox from './Box';
import ReturniConWAllet from './IconWallet';
import ReturnSolde from './Solde'
import ReturnQuOte from './Quote';
import ReturnButtonWithdrAw from './Withdraw';
import ReturnTradedAsh from './Trade/Main';
import ReturnAddBtnMoney from './BtnAdd';

import AllExch from './All/Main';

// Dash Component Admin
export default function ReturndAsh() {
 return (
  <div className='wrp-dash-admin'>
   <ReturnBox />
   <ReturniConWAllet />
   <ReturnSolde />
   <ReturnAddBtnMoney />
   <ReturnQuOte />
   <ReturnButtonWithdrAw />
   <ReturnTradedAsh />
   <AllExch />

  </div>
 );
};
